import React from 'react';

function Food({ name, picture }) {
    return (
        <div>
            <h2>I like {name} </h2>
            <img src={picture} alt={name} />
        </div>
    );
}

const foodILike = [
    {
        id: 1,
        name: 'Kimchi',
        image: 'data:image/jpeg;base64,',
    },
    {
        id: 2,
        name: 'Samgyeopsal',
        image: 'data:image/jpeg;base64,',
    },
    {
        id: 3,
        name: 'Bibimbap',
        image: 'data:image/jpeg;base64,',
    },
    {
        id: 4,
        name: 'Kimbap',
        image: 'data:image/jpeg;base64,',
    },
];

function App() {
  return (
      <div>
          {foodILike.map(dish => (
              <Food key={dish.id} name={dish.name} picture={dish.image} />
          ))}
      </div>
  );
}

export default App;